import Image from "../Banner.jfif";
import Card from "./Card";
import camera from "../images/Jean.jpg"


let fetchRes = fetch(
  "https://fakestoreapi.com/products");
    
          // fetchRes is the promise to resolve
          // it by using.then() method
          fetchRes.then(res =>
              res.json()).then(d => {
                  <Card 
                    img={d.image}
                    h4 = {d.price}
                    p = {d.price}
                  
                  />
              })

function Main(){
    return (
      <>
      <div className='banner'>
        <img src={Image}></img>  
        </div>
        {fetchRes}
        
      </>
    
  
    )
  }

  export default Main;
